import React from "react";


function BottomMenu(props) {

    return (
        <div className="bottomMenu">
            {props.bottomMenuItems.map((data) => {
                return <MenuItem
                    key={data}
                    name={data}
                    subMod={props.SetSubModule}
                />
            })}
        </div>
    )
}

function MenuItem(props) {
    return <button onClick={props.subMod} name={props.name} className="button btn-botMenu">{props.name}</button>
}

export default BottomMenu;
